import Link from 'next/link';
import Layout from '../components/Layout';
import Sampledata from '../components/Sampledata';


export default () => (
  <Layout header="Fire" title="Sample data.">
    <Sampledata />
    <Link href="./find_fire">
      <button>find fire</button>
    </Link>
  </Layout>
);
